description:
Award winning director, William H., returns with five adorable and slutty girls starring in Cuties 2, the perfect series for fans of that Girl Next Door look. Featuring a collection of burgeoning industry starlets: Lexi Belle, Marie McCray, Allie Haze, Lily Carter, Jessie Summers. Do not miss.

Starring: Allie Haze, Jessie Summers, Lexi Belle, Lily Carter, Marie McCray

